import { View, Text } from 'tamagui' // or '@tamagui/core'



export default function App() {
  return (
      < View >
          <Text style={{ color: '#000' }}>Open up App.js to start working on your app!</Text>
      < / View >
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
